import  React, {useEffect, useState} from 'react';
import { 
    HomeContainer, 
    TitleName,TitleContainer, 
    Bio, 
    InfoContainer, 
    GithubContainer,
    TitleCard,
} from './styles';

import api from '../../services/api';
import GitHubIcon from '@material-ui/icons/GitHub';

interface IUser {
    name: string,
    avatar_url: string,
    bio: string,
    location: string,
    email: string,
    html_url: string, 
    repos_url: object,
  }


const Home = ()=> {
    const [user, setUsers] = useState({});

    const Search = async () => {
        await api.get('/users')
        .then((res) => {
            setUsers(res.data)
        }).catch((err) => {
            alert(err.response.data)
        })
    }

    useEffect(()=>{Search()}, [])
    console.log(user.name)

    return(
        <HomeContainer>
            <TitleContainer>
              <TitleName>KLIHSMAN</TitleName>
              <Bio>Olá, me chamo Klihsman Freitas, sou um desenvolvedor full-stack, com foco em desenvolvimento front-end na stack JS (Node, React e React-native). Tenho experiência em desenvolvimento de sites e aplicativos em geral. Além disso, sou formando em Análise e Desenvolvimento de sistemas pelo Instituto Federal da Paraíba (IFPB).</Bio>              
            </TitleContainer>
            <InfoContainer>
                <GithubContainer>
                    <TitleCard>
                        <h2>Github</h2>
                        <GitHubIcon />
                    </TitleCard>
                </GithubContainer>
            </InfoContainer>
        </HomeContainer>
    )
}

export default Home;
